import React from 'react'

export default class About extends React.Component {
    render() {
        return (
            <div id="aboutUs">
                <h1 id="aboutTitle"> About Us </h1>
                <p id="aboutTxt">  Capt. Strange saw that consumers were often slaves to the product. 
                The experience often lacked the combination of health properties, 
                uniqueness and creativity. He demanded more! 
                He decided to seek the truth and a resolution.</p>
            </div>
        )
    }
};
